// src/pages/MyReservations.js

import { useEffect, useState, useMemo } from 'react'; // Necesitas useMemo para el filtrado
import { msalInstance, loginRequest } from '../msalConfig'; 
import { useReservations } from '../context/ReservationsContext'; // Contexto
import { useNavigate } from 'react-router-dom';
import { Toaster } from 'sonner';

// --- FUNCIÓN DE UTILIDAD: EXTRACCIÓN ROBUSTA DEL NOMBRE DE LA SALA ---
// Nota: Esta lógica debería estar idealmente en el Contexto, pero la mantenemos aquí por si acaso.
const getRoomName = (reservation) => {
    // PRIORIDAD 1: Buscar el objeto 'room' que creamos localmente (Contexto)
    if (reservation.room?.nombre) {
        return reservation.room.nombre;
    }

    // PRIORIDAD 2: Buscar el recurso dentro del array de asistentes (Outlook)
    const roomAttendee = reservation.attendees?.find(a => a.type === 'resource');

    if (roomAttendee) {
        return roomAttendee.emailAddress?.name || roomAttendee.emailAddress?.address;
    }

    // PRIORIDAD 3: Usar el display name como fallback
    if (reservation.location?.displayName && reservation.location.displayName !== "Sala no especificada") {
        return reservation.location.displayName;
    }

    return 'Sala no especificada';
};

// --- FUNCIÓN DE UTILIDAD: FORMATEO DE HORA ---
const hhmm = (d) => d.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });

// --- FILTRO AUXILIAR DE FECHAS (Para listar solo las de hoy en adelante) ---
const isFutureOrToday = (d) => {
    const today = new Date();
    today.setHours(0, 0, 0, 0); // Neutralizamos la hora de hoy
    return d && d instanceof Date && d >= today;
};


export default function MyReservations() {
  // ✅ USAMOS LA LISTA GLOBAL DEL CONTEXTO
  const { reservations: globalReservations, removeById } = useReservations(); 

  const [loading, setLoading] = useState(false); // Ya no necesitamos un estado de carga complejo
  const [error, setError] = useState('');

  const navigate = useNavigate();

  // ✅ FILTRAMOS LAS RESERVAS GLOBALES PARA MOSTRAR SOLO LAS FUTURAS
  const futureReservations = useMemo(() => {
      // Filtramos para evitar mostrar reservas muy antiguas
      const future = globalReservations
          .filter(r => isFutureOrToday(r.startTime))
          // Ordenamos por hora de inicio
          .sort((a, b) => a.startTime.getTime() - b.startTime.getTime()); 
      return future;

  }, [globalReservations]);

  // En src/pages/MyReservations.js

const handleDelete = async (reservationId) => {
    // Usamos el toast nativo de confirmación o window.confirm
    if (!window.confirm('¿Estás seguro de que quieres eliminar esta reserva?')) {
        return;
    }

    const toastId = toast.loading('Eliminando reserva...');

    try {
        await removeById(reservationId);

        // ✅ ÉXITO
        toast.success('Reserva eliminada', {
            id: toastId,
            description: 'El evento se ha borrado de tu calendario.'
        });

    } catch (e) {
        // ✅ ERROR
        toast.error('No se pudo eliminar', {
            id: toastId,
            description: e.message
        });
    }
};

  // --- RENDERIZADO ---
  return (
    <div className="mx-auto max-w-4xl">
      {error && (<div className="mt-6 rounded-xl border border-red-200 bg-red-50 px-4 py-3 text-sm text-red-800">{error}</div>)}

      {futureReservations.length > 0 ? (
        <ul className="mt-4 space-y-3">
          {futureReservations.map((r) => {
            const start = r.startTime; // Ya es un objeto Date
            const end = r.endTime;     // Ya es un objeto Date
            const dateStr = start.toLocaleDateString([], { day: '2-digit', month: 'short' });

            return (
              <li key={r.id} className="rounded-2xl bg-white dark:bg-[#171B22] border border-gray-200 dark:border-[#232A36] px-4 py-3 shadow-sm">
                <div className="flex justify-between items-center">
                    <div className="font-semibold text-gray-900 dark:text-white">{r.title || '(Sin título)'}</div>

                    {/* BOTONES DE ACCIÓN */}
                    <div className='flex gap-2'>
                        <button
                          onClick={() => navigate(`/create-reservation/${r.id}`)} 
                          className='text-blue-600 hover:text-blue-500 text-sm'> Editar
                      </button>
                        <button
                            onClick={() => handleDelete(r.id)} 
                            className="text-red-600 hover:text-red-400 text-sm"> Eliminar
                        </button>
                    </div>
                </div>

                <div className="text-sm text-gray-600 dark:text-gray-400">
                  {/* El nombre de la sala se lee directamente de la data mapeada */}
                  {getRoomName(r) || 'Sala no especificada'} · {dateStr}, {hhmm(start)}–{hhmm(end)}
                </div>
              </li>
            );
          })}
        </ul>
      ) : (
        <div className="mx-auto max-w-4xl mt-10 p-6 text-center text-gray-600 dark:text-gray-400">
            {globalReservations.length > 0 ? (
                <p>No tienes reservas futuras pendientes. ¡Hora de crear una!</p>
            ) : (
                <p>Cargando reservas o no hay eventos en tu agenda.</p>
            )}
        </div>
      )}
    </div>
  );
}
